
/**
 * @desc app globals
 */
define([], function() {

	var app = {
		env : 'prod',
		loading_img_base64_100x100 : 'data:image/gif;base64,' ,
		loading_img_base64_70x50 : 'data:image/gif;base64,',
		loading_img_base64_120x90 : 'data:image/gif;base64,',
		loading_img_base64_720x375 : 'data:image/gif;base64,',
		context : function() {
			var rootcontext = '';
			var loc = window.location;
			var path = loc.pathname;
			if (path.indexOf('/embrace2')==0) {
				var ctx = path.split('/')[1];
				rootcontext = "/" + ctx + "/";
				console.log('Setting context root as '+rootcontext);
			}
			return rootcontext;
		}
	};
	return app;
});

